import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter } from "react-router-dom";
import App from "./App";

// Crée la racine de l'application et la rend sur l'élément avec id 'root'
const root = ReactDOM.createRoot(document.getElementById("root"));

// Rendu de l'application avec BrowserRouter pour gérer les routes
root.render(
  <BrowserRouter>
    <App />
  </BrowserRouter>
);
